import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Home from "./components/Home/Home";
import Login from "./components/Auth/Login";
import Register from "./components/Auth/Register";
import ProtectedRoute from "./components/Auth/ProtectedRoute";

import AdminDashboard from "./components/Dashboard/AdminDashboard";
import TeacherDashboard from "./components/Dashboard/TeacherDashboard";
import StudentDashboard from "./components/Dashboard/StudentDashboard";

import LiveRoom from "./components/LiveClass/LiveRoom";
import DoubtSolver from "./components/AI/DoubtSolver";

import AddClass from "./components/Class/AddClass";
import ViewClasses from "./components/Class/ViewClasses";

import AddAssignment from "./components/Assignment/AddAssignment";
import ViewAssignments from "./components/Assignment/ViewAssignments";

import ViewUsers from "./components/Admin/ViewUsers";
import AddUser from "./components/Admin/AddUser";

import MarkAttendance from "./components/Attendance/MarkAttendance";
import ViewAttendance from "./components/Attendance/ViewAttendance";
import School from "./components/Home/School";
import TeacherInfo from "./components/Home/TeacherInfo";
import StudentInfo from "./components/Home/StudentInfo";



export default function App() {
  return (
    <Router>
      <Routes>
        {/* ===== PUBLIC ROUTES ===== */}
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* ===== DASHBOARDS ===== */}
        <Route
          path="/student"
          element={
            <ProtectedRoute roles={["student"]}>
              <StudentDashboard />
            </ProtectedRoute>
          }
        />

        <Route
          path="/teacher"
          element={
            <ProtectedRoute roles={["teacher"]}>
              <TeacherDashboard />
            </ProtectedRoute>
          }
        />

        <Route
          path="/admin"
          element={
            <ProtectedRoute roles={["admin"]}>
              <AdminDashboard />
            </ProtectedRoute>
          }
        />

        {/* ===== COMMON ROUTES ===== */}
        <Route
          path="/classes"
          element={
            <ProtectedRoute roles={["student", "teacher", "admin"]}>
              <ViewClasses />
            </ProtectedRoute>
          }
        />

        <Route
          path="/attendance"
          element={
            <ProtectedRoute roles={["student", "teacher", "admin"]}>
              <ViewAttendance />
            </ProtectedRoute>
          }
        />

        <Route
          path="/assignments"
          element={
            <ProtectedRoute roles={["student", "teacher", "admin"]}>
              <ViewAssignments />
            </ProtectedRoute>
          }
        />

        <Route
          path="/doubt"
          element={
            <ProtectedRoute roles={["student", "teacher", "admin"]}>
              <DoubtSolver />
            </ProtectedRoute>
          }
        />

        <Route
          path="/live/:classId"
          element={
            <ProtectedRoute roles={["student", "teacher", "admin"]}>
              <LiveRoom />
            </ProtectedRoute>
          }
        />

        {/* ===== TEACHER / ADMIN ROUTES ===== */}
        <Route
          path="/add-class"
          element={
            <ProtectedRoute roles={["teacher", "admin"]}>
              <AddClass />
            </ProtectedRoute>
          }
        />

        <Route
          path="/add-assignment"
          element={
            <ProtectedRoute roles={["teacher"]}>
              <AddAssignment />
            </ProtectedRoute>
          }
        />

        <Route
          path="/mark-attendance"
          element={
            <ProtectedRoute roles={["teacher"]}>
              <MarkAttendance />
            </ProtectedRoute>
          }
        />

        {/* ===== ADMIN ROUTES ===== */}
        <Route
          path="/add-user"
          element={
            <ProtectedRoute roles={["admin"]}>
              <AddUser />
            </ProtectedRoute>
          }
        />

        <Route
          path="/users"
          element={
            <ProtectedRoute roles={["admin"]}>
              <ViewUsers />
            </ProtectedRoute>
          }
        />
<Route path="/school" element={<School />} />
<Route path="/teacher-info" element={<TeacherInfo />} />
<Route path="/student-info" element={<StudentInfo />} />
<Route
  path="/doubt"
  element={
    <ProtectedRoute roles={["student", "teacher", "admin"]}>
      <DoubtSolver />
    </ProtectedRoute>
  }
/>
<Route
  path="/ai-chat"
  element={
    <ProtectedRoute roles={["student", "teacher", "admin"]}>
      <ChatAI />
    </ProtectedRoute>
  }
/>


      </Routes>
    </Router>
  );
}
